import React, { FC } from "react";

interface CarouselProps {
  children: React.ReactNode;
}

const Carousel: FC<CarouselProps> = ({ children }) => {
  return (
    <div className="carousel-container">
      {children}
    </div>
  );
};

export default Carousel;
